import React, {Component} from 'react';
import './App.css';
import SearchForm from './SearchForm.js';
import AddForm from './AddForm.js';
import GalleryForm from './GalleryFrom.js'
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
            <h2>Camp Butterfly</h2>
        </header>
        <Router>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/add">Add</Link>
            </li>
            <li>
              <Link to="/gallery">Gallery</Link>
            </li>
          </ul>
          <Switch>
            <Route path="/">
              <SearchForm />
            </Route>
            <Route path="/add">
              <AddForm />
            </Route>
            <Route path="/gallery">
              <GalleryForm />
            </Route>
          </Switch>
        </Router>
        <SearchForm />
      </div>
    );
  }
}

export default App;
